import React, { Component } from "react";
import Plot from "react-plotly.js";

export class ELFPlot extends Component {
  constructor(props) {
    super(props);
    this.spd_test = this.props.test;
    this.spd_ref = this.props.ref_spd;
    console.log("SPD_Test = ");
    console.log(this.spd_test);
    var i;

    this.wavelength = [];
    for (i = 0; i < 400; i++) {
      this.wavelength[i] = i + 380;
    }

    console.log("Wavelengths = ");
    console.log(this.wavelength);

    this.test = [];
    for (i = 0; i <= 400; i++) {
      //this.test[i] = this.spd_test[i];
    }
  }
  render() {
    return (
      <Plot>
        title={null}
        data=
        {[
          {
            x: this.wavelength,
            y: this.spd_test,
            type: "scatter",
            mode: "lines+points",
            marker: { color: "red" }
          }
        ]}
        layout={{ width: 50, height: 20, title: "A Fancy Plot" }}
      </Plot>
    );
  }
}

export default ELFPlot;
